import React from 'react'
import { Container, Row ,Col,Button } from 'react-bootstrap'
import headerimg from './assets/insta.png';
import {useState,useEffect} from 'react';
import {ArrowRight} from 'react-bootstrap-icons';

export const Home = () => {
    return (
        <section className='home text-light' id='home'>
            <Container>
                <span className='tag-line'><h1 style={{fontSize:50}}>Welcome to my Portfolio</h1></span>
                <h1 style={{fontFamily:'cursive'}}>{`Hi I'm `}<span className='wrap'>Web developer</span></h1>
                <p><h6>I'm a Web Developer specialising in React.JS,i love to build amazing websites.<br/>
                Additionally,I have experience in HTML,CSS
                </h6></p>
                <Button variant='link' onClick={()=> console.log('connect')}>Let's connect <ArrowRight size={25}/></Button>
            </Container>
        </section>
    )
}
